async function stationNbOutgoing(stationId) {
	// Imports the Google Cloud client library
	const {BigQuery} = require('@google-cloud/bigquery');

	var res = {
		"type": "FeatureCollection",
		"features": []
	};
	const toStationsQuery = `SELECT 
	ST_AsGeoJSON(ST_GeogPoint(longitude, latitude)) AS point, 
		s.name, 
		s.id,
		b.nb_outgoing
	FROM \`bigquery-public-data.london_bicycles.cycle_stations\` s,
	(
		SELECT
			end_station_id, count(*) nb_outgoing
		FROM \`bigquery-public-data.london_bicycles.cycle_hire\`
		WHERE start_station_id = ${stationId} AND end_station_id != ${stationId} 
		GROUP BY end_station_id 
		ORDER BY count(*) DESC LIMIT 50
	) b WHERE b.end_station_id = s.id `;
	console.log(`Query: ${toStationsQuery}`);

	const bigquery = new BigQuery();
	const options = {
	    query: toStationsQuery,
	    // Location must match that of the dataset(s) referenced in the query.
	    location: 'EU',
	};

	// Runs the query as a job
	const [job] = await bigquery.createQueryJob(options);
	console.log(`Job ${job.id} started.`);

	// Waits for the query to finish
	const [rows] = await job.getQueryResults();	
	rows.forEach(row => {
	  	const pt = row['point'];
		const r_name = row['name'];
		const r_id = row['id'];
		const r_nboutgoing = row['nb_outgoing'];
		res.features.push({
			"type": "Feature",
			"properties" : {
				"id" : r_id,
				"name" : r_name,
				"nb_outgoing" : r_nboutgoing
			},
			"geometry" : JSON.parse(pt)});
	});
	return res;
};

