async function nyYellowCabs(stationId) {
	const {BigQuery} = require('@google-cloud/bigquery');

	var res = {
		"type": "FeatureCollection",
		"features": []
	};
	const nyycabquery = `SELECT 
	  ST_AsGeoJSON(z.zone_geom) AS zone_geom,  
	  z.zone_id, 
	  z.zone_name, 
	  z.borough,
	  IFNULL(p.nb_pickup, 0)  nb_pickup,
	  IFNULL(d.nb_dropoff, 0) nb_dropoff,
	  IFNULL(d.nb_dropoff, 0) - IFNULL(p.nb_pickup, 0) diff_dropoff,
	  IFNULL(p.nb_pickup, 0) - IFNULL(d.nb_dropoff, 0) diff_pickup
	FROM \`bigquery-public-data.new_york_taxi_trips.taxi_zone_geom\` z
	LEFT JOIN (
	  SELECT 
	  pickup_location_id, count(*) nb_pickup
	  FROM \`bigquery-public-data.new_york_taxi_trips.tlc_yellow_trips_2018\`
	  GROUP BY pickup_location_id
	)  p on p.pickup_location_id = z.zone_id
	LEFT JOIN (
	  SELECT 
	  dropoff_location_id , count(*) nb_dropoff
	  FROM \`bigquery-public-data.new_york_taxi_trips.tlc_yellow_trips_2018\`
	  GROUP BY dropoff_location_id
	) d on d.dropoff_location_id = z.zone_id`;

	console.log(`Query: ${nyycabquery}`);

	const bigquery = new BigQuery();
	const options = {
	    query: nyycabquery,
	    // Location must match that of the dataset(s) referenced in the query.
	    location: 'US',
	};

	// Runs the query as a job
	const [job] = await bigquery.createQueryJob(options);
	console.log(`Job ${job.id} started.`);

	// Waits for the query to finish
	const [rows] = await job.getQueryResults();	
	rows.forEach(row => {
	  	const z_geom = row['zone_geom'];
		const z_name = row['zone_name'];
		const z_id = row['zone_id'];
		const r_nbpickup = row['nb_pickup'];
		const r_nbdropoff = row['nb_dropoff'];
		res.features.push({
			"type": "Feature",
			"properties" : {
				"id" : z_id,
				"name" : z_name,
				"nb_pickup" : r_nbpickup,
				"nb_dropoff" : r_nbdropoff,
				"diff_dropoff" : row["diff_dropoff"],
				"diff_pickup" : row["diff_pickup"]			
			},
			"geometry" : JSON.parse(z_geom)
		});
	});
	return res;
};

